import Link from 'next/link'

const linkStyle = {
  marginRight: 15,
  paddingLeft: 20
}

export default function Header() {
  return (
    <div>
    <div className="rectangle1">
      <Link className="title" href="/">
        <h1>Jack Diamond</h1>
      </Link>
      <Link className="questions" href="/experience">
        <a class="questions">questions</a>
      </Link>
      <Link href="/projects">
        <a style={linkStyle}>Projects</a>
      </Link>
      <Link href="/resume">
        <a style={linkStyle}>Resume</a>
      </Link>
      <Link href="/contact">
        <a style={linkStyle}>Contact</a>
      </Link>

    </div>
    <style jsx>{`
      .rectangle1 {
        position: absolute;
        left: 0%;
        right: 0%;
        top: 0%;
        bottom: 0%;

        background: #FFFFFF;
        box-shadow: 0px 1px 0px rgba(0, 0, 0, 0.25);
      }

      .title {
        position: absolute;
        left: 5.58%;
        right: 72.97%;
        top: 30.77%;
        bottom: 28.85%;

        font-family: Roboto;
        font-style: normal;
        font-weight: normal;
        font-size: 18px;
        line-height: 21px;

        color: #000000;
      }

      .questions {
        position: absolute;
        left: 57.82%;
        right: 35.64%;
        top: 36.54%;
        bottom: 36.54%;

        font-family: Roboto;
        font-style: normal;
        font-weight: normal;
        font-size: 12px;
        line-height: 14px;

        color: rgba(0, 0, 0, 0.6);
      }

      h1 {
        flex-direction: row;
        flex-grow: 2;
        font-family: Sans-Serif;
      }

      a {
        padding: 0 10px;
        text-decoration: none;
        font-size: 16px;
        color: #666;
        font-family: Sans-Serif;
      }
    `}</style>
    </div>
  )
}
